;; **
;;; ### Defining formulas
;;; first we define formulas to be used on data
;; **

;; @@
(defn d [R N D W]
  "d = log10(R/60N)/log10(12W/106D) where : R=ROP (ft/hr) N=RPM (rev/min) W=WOB (lbs) D=bit size (ins)"
  (/ (Math/log10 (/ R (* 60 N)))
     (Math/log10 (/ (* 12 W) (* 1000 D)))))


(defn dxc [MW1 MW2 R N D W]
  (* (d R N D W) (/ MW1 MW2)))
